import React from "react";

import { EuiText, EuiCard, EuiFlexGroup, EuiFlexItem } from "@elastic/eui";

const Card = (props) => (
  <EuiFlexItem>
    <EuiCard
      style={{ width: "18rem" }}
      textAlign="left"
      image={
        <div>
          <img
            src={props.item.media.thumbnail[0].url}
            alt=""
            height="250px"
            width="150px"
          />
        </div>
      }
      title={props.item.name}
      description={<h3>Starts at {props.item.price.offer_price.value}</h3>}
    />
  </EuiFlexItem>
);

export default Card;
